window.bookSummaryJSON = "<p>I've managed to survive my first week in Euphoria Online. But I couldn't have done it without my new friends. Lotharia. Falkon. The Green Liver goblins.</p> <p>But now Lotharia's gone missing. Swallowed by that nightmare keep. Lost to the darkness.&nbsp;&nbsp;&nbsp;</p> <p>Everyone's telling me that going after her is madness. That I don't have a chance in hell.&nbsp;&nbsp;&nbsp;</p> <p>But I'm not the kind of guy to turn my back on my friends.&nbsp;&nbsp;</p> <p>Damn the odds.&nbsp;</p> <p>I'm going to find her.&nbsp;&nbsp;</p>"; 
